import React from "react";
import Stephen_Mia from "../assets/Stephen_Mia.jpeg";

function Header() {
  return (
    <div className="header-container">
      <div className="profile-pic-container">
        <img src={Stephen_Mia} alt="profile picture" />
      </div>
    </div>
  );
}

export default Header;
